import { NextPage } from 'next';
import IntroContainer from '../components/IntroContainer';
import ForSaleContainer from '../components/ForSaleContainer';
import GalleryContainer from '../components/GalleryContainer';
import AboutContainer from '../components/AboutContainer';

import Header from '../components/Header';

const Index: NextPage = () => {
    return (
        <div>
            <IntroContainer />
            <ForSaleContainer />
            <GalleryContainer />
            <AboutContainer />

            <div className="container biography-container">
                <Header color="white" addTopMargin={true}>
                    About
                </Header>
                <div className="biography-text-container">
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>
                    <p>Email: anita-sculpts@protonmail.com</p>
                </div>
            </div>
        </div>
    );
};

export default Index;
